import java.util.HashMap;
import java.util.Arrays;

class Solution {
    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }

        // Runtime: 34 ms, faster than 7.98% of Java online submissions for Valid Anagram.
        // Memory Usage: 43.2 MB, less than 69.41% of Java online submissions for Valid Anagram.
        HashMap<String, Integer> charStatS = new HashMap<String, Integer>();
        HashMap<String, Integer> charStatT = new HashMap<String, Integer>();
        
        for (int si = 0; si < s.length(); si ++) {
            // String sPosition = Integer.toString(charStatS.get(Character.toString(s.charAt(si))));
            if (charStatS.get(Character.toString(s.charAt(si))) == null) {
                charStatS.put(Character.toString(s.charAt(si)), 1);
            } else {
                charStatS.put(Character.toString(s.charAt(si)), charStatS.get(Character.toString(s.charAt(si))) + 1);
            }


            if (charStatT.get(Character.toString(t.charAt(si))) == null) {
                charStatT.put(Character.toString(t.charAt(si)), 1);
            } else {
                charStatT.put(Character.toString(t.charAt(si)), charStatT.get(Character.toString(t.charAt(si))) + 1);
            }
        }

        if (charStatS.keySet().size() == charStatT.keySet().size()) {
            for (String key: charStatS.keySet()) {  
                if (!charStatS.get(key).equals(charStatT.get(key))) {
                    return false;
                }
            }
        } else {
            return false;
        }

        return true;

        // Runtime: 9 ms, faster than 41.80% of Java online submissions for Valid Anagram.
        // Memory Usage: 45.2 MB, less than 29.71% of Java online submissions for Valid Anagram.
        
        // char[] sCharArray = s.toCharArray();
        // char[] tCharArray = t.toCharArray();
        // Arrays.sort(sCharArray);
        // Arrays.sort(tCharArray);

        // for (int si = 0; si < s.length(); si ++) {
        //     if (sCharArray[si] != tCharArray[si]){
        //         return false;
        //     }
        // }

        // Or
        
        // String sSorted = String.valueOf(sCharArray);
        // String tSorted = String.valueOf(tCharArray);
        // if (!sSorted.equals(tSorted)) {
        //     return false;
        // }

        // return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        String s = "";
        String t = "";
        boolean result = solution.isAnagram(s, t);
        System.out.println(result);
    }
}
